	add("jesse", "{\"term\":\"jesse\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Hebrew\"], \"text\":\"From Ancient greek (to 1453) \u0027ἰεσσαί\u0027 from Hebrew \u0027יִשַׁי\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The father of king David\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1 Samuel 17:12\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Now David was the son of that Ephrathite of Bethlehemjudah, whose name was \u0027\u0027Jesse\u0027\u0027; and he had eight sons; and the man went among men for an old man in the days of Saul\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"of biblical origin\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1882\u0027\u0027, \u0027Jesse James\u0027 (folk song\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Jesse\u0027\u0027 James was a lad that killed many a man, / He robbed the Glendale train. / He stole from the rich and he gave to the poor, / He\u0027d a hand and a heart and a brain\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"a variant of Jessie\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"1985\u0027\u0027 w:Alice Alice Munro, \u0027The Progress of Love\u0027, Chatto\u0026amp;Windus 1987, ISBN 0701131616, page 166-167\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"We had decided to change the spelling of our names. Mine was to become \u0027\u0027Jesse\u0027\u0027 instead of Jessie, and hers was to be Meribeth, not MaryBeth. We signed these names to the test papers we turned in at school\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"The teacher waved my paper in the air. \u0026quot;I can\u0027t give a mark to this person, because I don\u0027t know who this person is,\u0026quot; she said. \u0026quot;Who is this \u0027\u0027Jesse\u0027\u0027?\u0026quot; She spelled the name out loud. \u0026quot;That is a boy\u0027s name. Does anybody here know a boy named \u0027\u0027Jesse\u0027\u0027?\u0026quot\", \"priority\":10}]}, \"synonyms\":{}}");

	add("jessamy", "{\"term\":\"jessamy\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Equivalent to Jasmine and Jessamine. Popularized by the character Jessamy in Barbara Sleigh\u0027s 1967 children\u0027s book \u0027Jessamy\u0027.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"edition \u003d location \u003d Sevenoaks, publisher\u003dBloomsbury|isbn \u003d 0 340 19547 page \u003d url passage \u003d \u0027\u0027Jessamy’s\u0027\u0027 eyes widened. What was it Matchett had said? That she would not take sauce from \u0027\u0027Jessamy\u0027\u0027 because she was ‘only the housekeeper’s niece and the cook-housekeeper at that?’\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"edition \u003d location \u003d Sevenoaks, publisher\u003dBloomsbury|isbn \u003d 0 340 19547 page \u003d url passage \u003d ‘Aunt Maggie, why was I ever called \u0027\u0027Jessamy\u0027\u0027?’ And as she said it she wondered why she had never thought to ask before. Her aunt changed the heavy suitcase to the other hand and said, ‘It was your mother’s name.’ \u0027\u0027Jessamy’s\u0027\u0027 heart gave a little jump inside her, and aunt Maggie went on: ‘When I said I thought it was too fly-away, and wouldn’t Ann or Mary be more sensible, she said that the eldest daughter was always called \u0027\u0027Jessamy\u0027\u0027 in her family.’\", \"priority\":2}]}, \"synonyms\":{}}");

	add("jessica", "{\"term\":\"jessica\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Hebrew\"], \"text\":\"First used by Shakespeare in Merchant of Venice, probably from Hebrew יסכה|יִסְכָּה (Yiskah, \u0026quot;Iscah\u0026quot; in Genesis 11:29, \u0026quot;Jescha\u0026quot; in the Wycliffe version), a proper name meaning \u0026quot;one who looks forth\u0026quot; (but apparently not used as an ordinary word with that meaning).* By folk etymology seen as an elaborate form of Jessie, from Jane.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"formerly rare, but since the 1970s popular in all English-speaking countries\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1594\u0027\u0027 William Shakespeare: \u0027The Merchant of Venice: Act V: Scene I\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Lorenzo\u0027: In such a night / Did \u0027\u0027Jessica\u0027\u0027 steal from the wealthy Jew, / And with an unthrift love did run from Venice, / As far as Belmont\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Jessica\u0027: In such a night / Did young Lorenzo swear he lov\u0027d her well, / Stealing her soul with many vows of faith, / And ne\u0027er a true one\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Lorenzo\u0027: In such a night / Did pretty \u0027\u0027Jessica\u0027\u0027, like a little shrew, / Slander her love, and he forgave it her\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1996\u0027\u0027 w:Tad Tad Williams, \u0027The Writer\u0027s Child\u0027, The Sandman Book of Dreams, HarperCollins, ISBN 0002246325, page 154\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"She will be beautiful, of course - how could our child not be beautiful? We will name her...\u0027\u0027Jessica\u0027\u0027. Yes, that\u0027s a good name, not one of those lighter-than-air names so popular among writers of romances and fairy tales. That\u0027s a name a real little girl might have\", \"priority\":7}]}, \"synonyms\":{}}");

	add("jester", "{\"term\":\"jester\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|jest|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who jests, jokes or mocks\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A person in colorful garb and fool\u0027s cap who amused a medieval and early modern royal or noble court\", \"priority\":2}]}, \"synonyms\":{}}");

