	add("jesus", "{\"term\":\"jesus\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Hebrew\", \"Latin\"], \"text\":\"From Latin {{m|la|Iēsus}}, from Ancient greek (to 1453) {{m|grc|Ἰησοῦς}}, from Hebrew {{m|he|יֵשׁוּעַ|tr\u003dyešû‘a}}, a contracted form of {{m|he|יהושע|tr\u003dyəhôšu‘a|gloss\u003dJoshua}}. The form {{m|he|ישוע|tr\u003dyešû‘a}} is attested in some of the later books of the Hebrew Bible, and translated as Jeshua or Yeshua in some English editions (the former appearing in the King James Version). The Greek texts make no distinction between Jesus and Joshua, referring to them both as {{m|grc|Ἰησοῦς}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Jesus of Nazareth, a Jewish teacher whom Christians consider the son of God and call Jesus Christ in belief that he is the Messiah, and whom Muslims believe to be a prophet\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1971\u0027\u0027 , \u0027No More Dying Then\u0027, Random House (2009), ISBN 9780099534853, page 195\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Frensham opened the door and called a name that sounded like \u0027Haysus\u0027. Brandy was brought and various other bottles and decanters. When the manservant had gone, Frensham said, \u0027Odd, aren\u0027t they, the Spanish? Calling a boy \u0027\u0027Jesus\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Jesus son of Sirach wrote the \u0026quot;Wisdom of Sirach\u0026quot\", \"priority\":4}]}, \"synonyms\":{}}");

